import React, { Component } from "react";

export default class NavigationComponent extends Component {
  render() {
    const boxStyle = {
      padding: "10px",
    };

    const linkStyle = {
      color: "white !important",
    };

    const navStyle = {
      fontSize: "18px",
      backgroundColor: "#293462",
    };

    return (
      <div>
        <nav style={navStyle}>
          <div className="container">
            <ul class="d-flex">
              <ListItem text={"Trang Chu"} />
              <li style={boxStyle}>
                <a href="#">Thể Loại</a>
              </li>
              <li style={boxStyle}>
                <a href="#">Xếp Hạng</a>
              </li>
              <li style={boxStyle}>
                <a href="#">Tìm Truyện</a>
              </li>
              <li style={boxStyle}>
                <a href="#">Lịch Sử</a>
              </li>
              <li style={boxStyle}>
                <a href="#">Theo Dõi</a>
              </li>
            </ul>
          </div>
        </nav>
      </div>
    );
  }
}

function ListItem(props) {
  const boxStyle = {
    padding: "10px",
  };

  const linkStyle = {
    color: "white !important",
  };

  return (
    <li style={boxStyle}>
      <a style={linkStyle} class="" href="#">
        {props.text}
      </a>
    </li>
  );
}
